import React, { Component } from 'react'
import { Link } from 'react-router-dom'

class Nav extends Component {
    render() {
    return (
        <div>
            <link to='/'>ManagePage</link>
            <link to='/previewpage'>PreviewPage</link>
        </div>

    )
}
}

export default Nav
